#--------------------------------------------------------
#--FUNCTION To Return_total_funding_records Count--------
#--------------------------------------------------------

delimeter //
CREATE FUNCTION `Return_total_funding_records`(fromDate date,toDate date) RETURNS int(11)
BEGIN

RETURN(
select count(*)
from (
select b.CREATED_DATE as Transaction_date, p.MERCHANT_CODE as Parent_Merchant_id,p.BUSINESS_NAME as Parent_Merchant_Name,
b.MERCHANT_ID as SubMerchant_id,b.BUSINESS_NAME as SubMerchat_name,b.TOTAL_AMOUNT as TOTAL_AMOUNT,b.FEE_AMOUNT as FEE_AMOUNT
,b.TXN_AMOUNT as TXN_AMOUNT 
from PG_MERCHANT p 
join 
(
select a.CREATED_DATE as CREATED_DATE,
case pm.MERCHANT_TYPE when 'Merchant' then MERCHANT_CODE else pm.PARENT_MERCHANT_ID end as PARENT_MERCHANT_ID ,
a.MERCHANT_ID as MERCHANT_ID,a.TOTAL_AMOUNT as TOTAL_AMOUNT,a.FEE_AMOUNT as FEE_AMOUNT,a.TXN_AMOUNT as TXN_AMOUNT,
pm.BUSINESS_NAME as BUSINESS_NAME 
from (
select date(CREATED_DATE) as CREATED_DATE,MERCHANT_ID,sum(TOTAL_AMOUNT) as TOTAL_AMOUNT,sum(FEE_AMOUNT) as FEE_AMOUNT, 
sum(TXN_AMOUNT) as TXN_AMOUNT 
from PG_TRANSACTION 
where MERCHANT_SETTLEMENT_STATUS='Executed' 
group by MERCHANT_ID,date(CREATED_DATE)
)a join PG_MERCHANT pm on pm.MERCHANT_CODE=a.MERCHANT_ID 
where pm.MERCHANT_TYPE='SubMerchant'
)b on b.PARENT_MERCHANT_ID=id 
union all 
select a.CREATED_DATE,case pm.MERCHANT_TYPE when 'Merchant' then MERCHANT_CODE else pm.PARENT_MERCHANT_ID end as parentid,
case pm.MERCHANT_TYPE when 'Merchant' then BUSINESS_NAME else pm.BUSINESS_NAME end as parent_name ,
a.MERCHANT_ID,pm.BUSINESS_NAME as MERCHANT_NAME,a.TOTAL_AMOUNT,a.FEE_AMOUNT,a.TXN_AMOUNT 
from (select date(CREATED_DATE) as CREATED_DATE,MERCHANT_ID,sum(TOTAL_AMOUNT) as TOTAL_AMOUNT,
sum(FEE_AMOUNT) as FEE_AMOUNT, sum(TXN_AMOUNT) as TXN_AMOUNT from PG_TRANSACTION 
where MERCHANT_SETTLEMENT_STATUS='Executed'group by MERCHANT_ID,date(CREATED_DATE)
)a join PG_MERCHANT pm on pm.MERCHANT_CODE=a.MERCHANT_ID 
where pm.MERCHANT_TYPE='Merchant'
)x where x.Transaction_date <=date(toDate) 
and x.Transaction_date >= date(fromDate));

END //

#-------------------------------------------------
#--PROCEDURE for usp_dailyfunds_report------------
#-------------------------------------------------

DROP PROCEDURE IF EXISTS `usp_dailyfunds_report`;

delimiter //

CREATE PROCEDURE `usp_dailyfunds_report`(fromDate date,toDate date,startindex int,endindex int)
BEGIN

SELECT x.Transaction_date,
  x.BATCH_ID,
  x.Parent_Merchant_id,
  x.Parent_Merchant_Name,
  x.SubMerchant_id,
  x.SubMerchat_name,
  x.LOCAL_CURRENCY,
  x.BANK_ACC_NUM   AS Account_Number,
  x.ROUTING_NUMBER AS ROUTING_NUMBER,
  x.TOTAL_AMOUNT,
  x.FEE_AMOUNT,
  x.TXN_AMOUNT
FROM
  (SELECT b.CREATED_DATE AS Transaction_date,
    b.BATCH_ID           AS BATCH_ID,
    p.MERCHANT_CODE      AS Parent_Merchant_id,
    p.BUSINESS_NAME      AS Parent_Merchant_Name,
    b.MERCHANT_ID        AS SubMerchant_id,
    b.BUSINESS_NAME      AS SubMerchat_name,
    b.LOCAL_CURRENCY     AS LOCAL_CURRENCY,
    b.BANK_ACC_NUM       AS BANK_ACC_NUM,
    b.ROUTING_NUMBER     AS ROUTING_NUMBER,
    b.TOTAL_AMOUNT       AS TOTAL_AMOUNT,
    b.FEE_AMOUNT         AS FEE_AMOUNT ,
    b.TXN_AMOUNT         AS TXN_AMOUNT
  FROM PG_MERCHANT p
  JOIN
    (SELECT a.CREATED_DATE AS CREATED_DATE,
      a.BATCH_ID           AS BATCH_ID,
      pm.LOCAL_CURRENCY    AS LOCAL_CURRENCY,
      CASE pm.MERCHANT_TYPE
        WHEN 'Merchant'
        THEN pm.MERCHANT_CODE
        ELSE pm.PARENT_MERCHANT_ID
      END                AS PARENT_MERCHANT_ID ,
      a.MERCHANT_ID      AS MERCHANT_ID,
      pmb.BANK_ACC_NUM   AS BANK_ACC_NUM,
      pmb.ROUTING_NUMBER AS ROUTING_NUMBER,
      a.TOTAL_AMOUNT     AS TOTAL_AMOUNT,
      a.FEE_AMOUNT       AS FEE_AMOUNT,
      a.TXN_AMOUNT       AS TXN_AMOUNT,
      pm.BUSINESS_NAME   AS BUSINESS_NAME
    FROM
      (SELECT DATE(CREATED_DATE) AS CREATED_DATE,
        BATCH_ID                 AS BATCH_ID,
        MERCHANT_ID,
        SUM(TOTAL_AMOUNT) AS TOTAL_AMOUNT,
        SUM(FEE_AMOUNT)   AS FEE_AMOUNT,
        SUM(TXN_AMOUNT)   AS TXN_AMOUNT
      FROM PG_TRANSACTION
      WHERE MERCHANT_SETTLEMENT_STATUS='Executed'
      GROUP BY MERCHANT_ID,
        DATE(CREATED_DATE)
      )a
    JOIN PG_MERCHANT pm
    ON pm.MERCHANT_CODE=a.MERCHANT_ID
    JOIN PG_MERCHANT_BANK pmb
    ON pmb.ID                 =pm.ID
    WHERE pm.MERCHANT_TYPE    ='SubMerchant'
    )b ON b.PARENT_MERCHANT_ID=id
  UNION ALL
  SELECT a.CREATED_DATE,
    a.BATCH_ID,
    CASE pm.MERCHANT_TYPE
      WHEN 'Merchant'
      THEN pm.MERCHANT_CODE
      ELSE pm.PARENT_MERCHANT_ID
    END AS parentid,
    CASE pm.MERCHANT_TYPE
      WHEN 'Merchant'
      THEN BUSINESS_NAME
      ELSE pm.BUSINESS_NAME
    END  AS parent_name ,
    NULL AS SubMerchant,
    NULL AS SubMerchant,
    pm.LOCAL_CURRENCY,
    pmb.BANK_ACC_NUM,
    pmb.ROUTING_NUMBER,
    a.TOTAL_AMOUNT,
    a.FEE_AMOUNT,
    a.TXN_AMOUNT
  FROM
    (SELECT DATE(CREATED_DATE) AS CREATED_DATE,
      MERCHANT_ID,
      BATCH_ID          AS BATCH_ID,
      SUM(TOTAL_AMOUNT) AS TOTAL_AMOUNT,
      SUM(FEE_AMOUNT)   AS FEE_AMOUNT,
      SUM(TXN_AMOUNT)   AS TXN_AMOUNT
    FROM PG_TRANSACTION
    WHERE MERCHANT_SETTLEMENT_STATUS='Executed'
    GROUP BY MERCHANT_ID,
      DATE(CREATED_DATE)
    )a
  JOIN PG_MERCHANT pm
  ON pm.MERCHANT_CODE=a.MERCHANT_ID
  JOIN PG_MERCHANT_BANK pmb
  ON pmb.ID             =pm.ID
  WHERE pm.MERCHANT_TYPE='Merchant'
  )x where x.Transaction_date <=date(toDate) 
and x.Transaction_date >= date(fromDate)
ORDER BY x.Transaction_date DESC limit startindex,endindex;
END //